function arrondsup(arg) {
    var x = (Math.round(arg / 10)) * 10
    return x
}
function importCG() {
    getmasse = localStorage.getItem("MasseTotale")
    getmasseatt = localStorage.getItem("MasseAtt")
    getmassedeg = localStorage.getItem("MasseDeg")
    getdurée = localStorage.getItem("durée")
    getreservoirP = localStorage.getItem("reservoirP")
    getmasseTROkg = localStorage.getItem("masseTROkg")
    getmasseZFM = localStorage.getItem("ZFM")

    getmassearrond = arrondsup(getmasse)
    getmasseattarrond = arrondsup(getmasseatt)
    getmassedegarrond = arrondsup(getmassedeg)

    console.log(getmassearrond + " " + getmasseattarrond + " " + getmassedegarrond);
    console.log(getmasse + "   " + getmasseatt + "  " + getmassedeg + " " + getdurée + " " + getreservoirP);


    if (getmassearrond > 2910) {
        alert("Masse max dépassée!")

    }

    document.querySelector("#masseid").value = getmassearrond
    document.querySelector("#masseidatt").value = getmasseattarrond

    if (getmassedegarrond < 2500) {
        document.querySelector("#masseiddeg").value = "2500"
        console.log("2500");

    }

    else { document.querySelector("#masseiddeg").value = getmassedegarrond }


    document.querySelector("#feuille_perfos > tbody > tr:nth-child(2) > td:nth-child(2)").innerHTML = getreservoirP
    document.querySelector("#feuille_perfos > tbody > tr:nth-child(4) > td:nth-child(2)").innerHTML = getdurée
}
