function essaiLoop() {
    cdt = [deco, att, deg]

    for (let i = 0; i < cdt.length; i++) {
        massepriseEnCompte = cdt[i][0]
        // console.log(massepriseEnCompte)
        if (i === 0) {
            document.querySelector("#perfos_ifr > tbody > tr:nth-child(6) > td:nth-child(2)").innerHTML = cdt[i][0] + " Kg"
            document.querySelector("#feuille_perfos > tbody > tr:nth-child(6) > td:nth-child(2)").innerHTML = cdt[i][0]
            document.querySelector("#feuille_perfos > tbody > tr:nth-child(3) > td:nth-child(7)").innerHTML = cdt[i][1]
            document.querySelector("#perfos_ifr > tbody > tr:nth-child(8) > td:nth-child(3)").innerHTML = cdt[i][1]
            document.querySelector("#feuille_perfos > tbody > tr:nth-child(3) > td:nth-child(5)").innerHTML = cdt[i][2]
            document.querySelector("#perfos_ifr > tbody > tr:nth-child(8) > td:nth-child(2)").innerHTML = cdt[i][2]
        }

        if (i == 1) {
            document.querySelector("#perfos_ifr > tbody > tr:nth-child(6) > td:nth-child(3)").innerHTML = cdt[i][0] + " Kg"
            document.querySelector("#feuille_perfos > tbody > tr:nth-child(6) > td:nth-child(4)").innerHTML = cdt[i][0]
            document.querySelector("#feuille_perfos > tbody > tr:nth-child(4) > td:nth-child(6)").innerHTML = cdt[i][1]
            document.querySelector("#perfos_ifr > tbody > tr:nth-child(8) > td:nth-child(5)").innerHTML = cdt[i][1]
            document.querySelector("#feuille_perfos > tbody > tr:nth-child(4) > td:nth-child(4)").innerHTML = cdt[i][2]
            document.querySelector("#perfos_ifr > tbody > tr:nth-child(8) > td:nth-child(4)").innerHTML = cdt[i][2]
        }

        else {
            document.querySelector("#perfos_ifr > tbody > tr:nth-child(6) > td:nth-child(4)").innerHTML = cdt[i][0] + " Kg"
            document.querySelector("#perfos_ifr > tbody > tr:nth-child(8) > td:nth-child(7)").innerHTML = cdt[i][1]
            document.querySelector("#perfos_ifr > tbody > tr:nth-child(8) > td:nth-child(6)").innerHTML = cdt[i][2]

        }
    }
}

